- input: "TEXT\x1CC00377952\x1C.TEXT\x1C\x1CF3XN\x1CWhen preparing our June bank reconciliation
    and mid-year PAC report, we discovered that the June 15, 2009 payroll deductions
    were withheld from employees, but not deposited to the CIPAC bank account.  The
    company, as the collecting agent, mistakenly directed the funds to a separate
    non-company account as a result of a clerical error.  The contributions were from
    92 people and the total amount affected was $3,163.67.  We spoke with Corbin Jones,
    our FEC Analyst, on 7/27/09 and confirmed that based on guidance from AO 1999-33
    we are able to accept the contributions.  Our company which is the collecting
    agent will deposit these funds to our account.\n"
